description:
The adaptation of Writer/Director Michael Dougherty's film of Multi-faceted tales of horror and suspense are brought to life by writer Marc Andreko (Manhunter) and Artists Mike Huddleston (Man-Bat, Gen13), Grant Bond (The Clockwork Girl), Christopher Gugliotti (The Texas Chainsaw Massacre) and Fiona Staple (North 40).  Featuring a cover from the film's concept designer Breehn Burns.

Halloween has always been a night of tricks and treats, but this year, it's nothing but a cornucopia of tricks as werewolves, demons, killers and zombies celebrate the festival of Samhain! 


